import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  Workflow,
  ClipboardList,
  LogOut,
  UsersRound,
  Sparkles,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";

const Sidebar: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Dashboard", icon: LayoutDashboard, path: "/dashboard", badge: null },
    { label: "Chat", icon: MessageSquare, path: "/chat", badge: 3 },
    { label: "Tasks", icon: ClipboardList, path: "/tasks", badge: 5 },
    { label: "Meetings", icon: UsersRound, path: "/meetings", badge: null },
    { label: "Calendar", icon: CalendarDays, path: "/calendar", badge: null },
    { label: "Files", icon: FileUp, path: "/files", badge: null },
    { label: "Workflows", icon: Workflow, path: "/workflows", badge: null },
  ];

  return (
    <aside className="h-screen w-64 flex flex-col bg-white border-r border-slate-200/60 shadow-sm">
      {/* Logo Section */}
      <div
        className="relative flex flex-col items-center justify-center py-6 px-4 cursor-pointer group border-b border-slate-200/60"
        onClick={() => navigate("/dashboard")}
      >
        {/* Subtle gradient background on hover */}
        <div className="absolute inset-0 bg-gradient-to-br from-blue-50/50 via-purple-50/50 to-pink-50/50 opacity-0 group-hover:opacity-100 transition-opacity duration-500" />

        {/* Logo with subtle glow */}
        <div className="relative">
          <div className="absolute inset-0 bg-blue-500/10 blur-xl rounded-full scale-0 group-hover:scale-100 transition-transform duration-500" />
          <img
            src="/logo1.png"
            alt="Collabryta Logo"
            className="relative w-16 h-16 object-contain drop-shadow-lg transition-all duration-500 group-hover:scale-105"
          />
        </div>

        {/* Brand text with gradient */}
        <h1 className="relative mt-3 text-xl font-black bg-gradient-to-r from-blue-600 via-purple-600 to-pink-600 bg-clip-text text-transparent tracking-tight">
          Collabryta
        </h1>
        <p className="relative text-xs font-medium text-slate-500 mt-1 flex items-center gap-1">
          <Sparkles size={12} className="text-yellow-500" />
          Innovate Together
        </p>
      </div>

      {/* Navigation */}
      <nav className="flex-1 overflow-y-auto px-3 py-4 space-y-1 scrollbar-thin scrollbar-thumb-slate-300 scrollbar-track-transparent">
        {navItems.map(({ label, icon: Icon, path, badge }) => {
          const active = location.pathname === path;
          return (
            <button
              key={path}
              onClick={() => navigate(path)}
              className={`
                relative w-full flex items-center gap-3 px-4 py-3 rounded-xl
                font-medium text-sm transition-all duration-300 group/item
                ${active
                  ? "bg-gradient-to-r from-blue-500 to-purple-600 text-white shadow-md shadow-blue-500/20"
                  : "text-slate-700 hover:bg-slate-50 hover:shadow-sm"
                }
              `}
            >
              {/* Active indicator */}
              {active && (
                <div className="absolute left-0 top-1/2 -translate-y-1/2 w-1 h-6 bg-white rounded-r-full" />
              )}

              {/* Icon */}
              <Icon
                size={20}
                className={`transition-transform duration-300 ${active ? "" : "group-hover/item:scale-110"
                  }`}
              />

              {/* Label */}
              <span className="flex-1 text-left">{label}</span>

              {/* Badge */}
              {badge && badge > 0 && (
                <span className={`
                  px-2 py-0.5 text-xs font-bold rounded-full min-w-[20px] text-center
                  ${active
                    ? "bg-white text-blue-600"
                    : "bg-gradient-to-r from-blue-500 to-purple-600 text-white"
                  }
                `}>
                  {badge}
                </span>
              )}
            </button>
          );
        })}
      </nav>

      {/* Divider */}
      <div className="h-px bg-gradient-to-r from-transparent via-slate-300 to-transparent mx-4" />

      {/* Logout Section */}
      <div className="px-3 py-4">
        <button
          onClick={() => navigate("/login")}
          className="
            w-full flex items-center justify-center gap-2 px-4 py-3 rounded-xl
            font-semibold text-sm transition-all duration-300
            bg-slate-100 text-slate-700 hover:bg-slate-200
            hover:shadow-md active:scale-95
            group
          "
        >
          <LogOut size={18} className="transition-transform duration-300 group-hover:-translate-x-1" />
          <span>Logout</span>
        </button>
      </div>
    </aside>
  );
};

export default Sidebar;
